import React from "react";
import { Container, Form  } from './styles'
import { FaGithub } from 'react-icons/fa'

export default function Main() {
    return (
        <Container>
            <h1>
                <FaGithub size={25} />
                Meus Repositórios
            </h1>

            <Form onSubmit={() => {}}>
                <input type="text" placeholder="Adicionar Repositórios" />
            </Form>
        </Container>
    )
}
